CREATE TABLE `energy_steam_meterreading` (
  `id` varchar(32) NOT NULL,
  `batchNumber` varchar(100) DEFAULT NULL,
  `meterNumber` varchar(100) DEFAULT NULL COMMENT '仪表编号',
  `meterName` varchar(100) DEFAULT NULL,
  `area` varchar(100) DEFAULT NULL,
  `areaCode` varchar(100) DEFAULT NULL,
  `realF` double DEFAULT NULL,
  `pressure` double DEFAULT NULL,
  `temp` double DEFAULT NULL,
  `totalF` double DEFAULT NULL,
  `readingTime` datetime DEFAULT NULL,
  `create_user` varchar(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `remarks` varchar(255) DEFAULT NULL,
  `del_flag` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

