/*Table structure for table `energy_water` */

DROP TABLE IF EXISTS `energy_water`;

CREATE TABLE `energy_water` (
  `id` varchar(32) NOT NULL,
  `meterNumber` varchar(100) DEFAULT NULL COMMENT '仪表编号',
  `parentNumber` varchar(100) DEFAULT NULL COMMENT '上级表编号',
  `area` varchar(100) DEFAULT NULL COMMENT '所在区域',
  `areaCode` varchar(100) DEFAULT NULL,
  `meterName` varchar(50) DEFAULT NULL COMMENT '仪表名称',
  `caliber` varchar(30) DEFAULT NULL COMMENT '管径',
  `meteringType` int(11) DEFAULT NULL COMMENT '计量类型',
  `meterModel` varchar(30) DEFAULT NULL COMMENT '仪表型号',
  `meterPosition` varchar(30) DEFAULT NULL COMMENT '仪表安装位置',
  `collectMode` int(11) DEFAULT NULL COMMENT '采集方式',
  `maxTotal` double(20,0) DEFAULT NULL COMMENT '最大值',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` varchar(1) DEFAULT NULL,
  `status` tinyint(11) DEFAULT NULL,
  `create_user` varchar(32) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_user` varchar(32) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
